/**
* Tests if a single-precision floating-point numeric value is `NaN`.
*
* @param x - value to test
* @returns boolean indicating whether the value is `NaN`
*
* @example
* var bool = isnanf( NaN );
* // returns true
*
* @example
* var bool = isnanf( 7.0 );
* // returns false
*/
declare function isnanf( x: number ): boolean;


// EXPORTS //

export = isnanf;
